import './App.css';
import Navbar from './components/Navbar/Navbar';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'

function App() {
  return (
    <Router>
      <div className="app">
        <div className="content">
          <Navbar />
          <Routes>
            <Route path="*">p</Route>
            <Route path="autoskola"><p>a</p></Route>
            <Route path="instruktor">i</Route>
            <Route path="kontakt">k</Route>
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
